import NodeMailerCreds from "../NodeMailerCreds";

const FROM_ACCOUNT = { user: NodeMailerCreds.user, pass: NodeMailerCreds.pass };

export const sendMessage = async (
  toAccount,
  message,
  subject,
  useTestAccount = false
) => {
